svg.script:
var Schalter1 = document.getElementById("Schalter1");
var Schalter1gedrueckt = document.getElementById("Schalter1gedrueckt");
var Schalter2 = document.getElementById("Schalter2");
var Schalter2gedrueckt = document.getElementById("Schalter2gedrueckt");


function addEventListeners() {
    Schalter1.addEventListener('mousedown', gedrueckt1);
    Schalter1.addEventListener('mouseup', losgelassen1);
    Schalter1.addEventListener('mouseout', losgelassen1);
    Schalter2.addEventListener('mousedown', gedrueckt2);
    Schalter2.addEventListener('mouseup', losgelassen2);
    Schalter2.addEventListener('mouseout', losgelassen2);
}

addEventListeners()

function gedrueckt1() {
    Schalter1.classList.remove("sichtbar");
    Schalter1.classList.add("unsichtbar");
    Schalter1gedrueckt.classList.remove("unsichtbar");
    Schalter1gedrueckt.classList.add("sichtbar");
}

function losgelassen1() {
    Schalter1.classList.remove("unsichtbar");
    Schalter1.classList.add("sichtbar");
    Schalter1gedrueckt.classList.remove("sichtbar");
    Schalter1gedrueckt.classList.add("unsichtbar");
}

function gedrueckt2() {
    Schalter2.classList.remove("sichtbar");
    Schalter2.classList.add("unsichtbar");
    Schalter2gedrueckt.classList.remove("unsichtbar");
    Schalter2gedrueckt.classList.add("sichtbar");
}

function losgelassen2() {
    Schalter2.classList.remove("unsichtbar");
    Schalter2.classList.add("sichtbar");
    Schalter2gedrueckt.classList.remove("sichtbar");
    Schalter2gedrueckt.classList.add("unsichtbar");
}
